import "../../css/AboutMe.css";
 import pic from "../../pics/avatar.png"

export default function About() {
  return (
    <div className="about-div">
      <h1>About ME Page</h1>
      <div>
      <img className = "about-img"src={pic} alt="Girl in a purple sweater" width="100" height="100"/>
      </div>
      <p>A Full-Stack Web Developer with a passion and drive for perfection.</p>
      <p>
        From graduating with a 4.0 GPA to obsessing over plating food, I like to
        give things my all and not settle for anything less than AMAZING. 
        I would love to hear from you!
      </p>
    </div>
  );
}
